/// <reference types="./semantic-conventions.d.ts" />

function createConstMap(values) {
	let res = {};
	const len = values.length;
	for (let lp = 0; lp < len; lp++) {
		const val = values[lp];
		if (val) {
			res[String(val).toUpperCase().replace(/[-.]/g, '_')] = val;
		}
	}
	return res;
}

